import styled from 'styled-components'
import Tests from '../src/components/tests'

const Container = styled.div`
  /* background-color: #0e0e10; */
  height: 100vh;
  padding: 8px;
`

const Title = styled.h1`
  color: red;
  text-transform: uppercase;
`

const Home = () => {
  return (
    <>
      <Container>
        <Title>Almorzanding</Title>
        <p>Hello Next.js</p>
        <Tests />
      </Container>
    </>
  )
}

export default Home
